import React from 'react'

const CreateStore = () => {

    const handleSubmit = (e) => {
        e.preventDefault()
    }

    return (
        <div className="create_store_cover">
            <div className="create_store">
                <form onSubmit={handleSubmit}>
                    <label> Your Name </label>
                    <input ref="ownername" type="text" />

                    <label> Give your store a name </label>
                    <input ref="storename" type="text" />
                </form>
            </div>
        </div>
    )
}

export default CreateStore
